(window.webpackJsonprecipes=window.webpackJsonprecipes||[]).push([[778],{2074:e=>{e.exports="# Cake chorizo-maroilles\n\n_Préchauffer le four à 180°._\n\n## Ingrédients\n\n- Farine | 150 g |\n- Oeufs | 3 |\n- Huile d'olive | 5 cl |\n- Lait | 12 cl |\n- Emmental râpé | 30 g |\n- Maroilles | 200 g |\n- Chorizo | 150 g |\n- Sel fin | 3 tours |\n- Poivre | 3 tours |\n\n## Cake\n\n1. Mélanger oeufs, farine, sel et poivre puis l'huile et le lait.\n\n2. Ajouter l'emmental puis le chorizo et le maroilles coupés en cubes.\n\n**Cuire 35 min.**\n"}}]);